import { AppBar, Toolbar, Typography } from '@mui/material';
import React from 'react'

function Footer() {
    return (
        <React.Fragment>
            <AppBar>
                <Toolbar>
                    <Typography>
                        Footer section
                    </Typography>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    )
}
export default Footer;
